import React from 'react'
import getBreeds from "../helpers/getBreeds";

const initialBreeds = [
	{
		id: 1,
		name: "Boxer",
	},
	{
		id: 2,
		name: "Husky",
	},
	{
		id: 3,
		name: "Pintscher",
	},
];

const Card = ({ dog }) => {
	return (
		<div className='card'>
			<img src={dog.image} alt='dog' />
			<p>{dog.name}</p>
		</div>
	);
};

export default Card
